import React from 'react';

const ProductList = ({ category, list }) => {
    const products = ({
        id: list.id,
        title: list.title,
        subtitle: list.subtitle,
        avatarSrc: list.avatarSrc,
        imgSrc: list.imgSrc,
        description: list.description,
    })

    const cat = ({
        category: category,
    })
    console.log(list);
    //container에서 넘어온 객체를 표현해주는 곳

    return (
        <div>
            <h1>카테고리 : {category}</h1>
            {list.map(products => (
                <div>
                    id={products.id}<br></br>
                    title={products.title}<br></br>
                    subtitle={products.subtitle}<br></br>
                    <br></br>
                </div>
            ))}
        </div>
    );
};

export default ProductList;
